import React from "react";
import Image from "../UI/Image";

const Header = (props) => {
  return (
    <div>
      <Image src="../Assets/Frame" />
      <div>
        <ul>
          <li>Home</li>
          <li>About</li>
          <li>Skills</li>
          <li>Portfolio</li>
          <li>Contact</li>
        </ul>
      </div>
      {/* button goes here */}
    </div>
  );
};

export default Header;
